process AnalyzeFedCablingFromConfigDb = {
    
    include "DQM/SiStripCommon/data/MessageLogger.cfi"
    
    include "OnlineDB/SiStripESSources/data/FedCablingFromConfigDbService.cff"
    replace SiStripConfigDb.ConfDb = ""
    replace SiStripConfigDb.Partition = ""
    replace FedCablingFromConfigDbService.CablingSource = "UNDEFINED"

    include "IORawData/SiStripInputSources/data/EmptySource.cfi"
    replace EmptySource.maxEvents = 2
    
    module test = AnalyzeFedCabling { }
    
    path p = { test }
    
}


